import React, { useState, useEffect, StrictMode } from 'react';
import {
  Box,
  Paper,
  IconButton,
  Typography,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  Tooltip,
  Select,
  MenuItem,
  Button,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  FormControl,
  InputLabel,
} from '@mui/material';
import {
  DragHandle as DragIcon,
  PlayArrow as PlayIcon,
  Delete as DeleteIcon,
  Send as SendIcon,
  Add as AddIcon,
  Settings as SettingsIcon,
  Info as InfoIcon,
} from '@mui/icons-material';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import { processWithAssistant, generateSummary } from '../utils/brainstormUtils';

// Model configuration presets
const MODEL_PRESETS = {
  creative: {
    name: "Creative",
    config: {
      temperature: 0.9,
      max_tokens: 2000,
      top_p: 0.95,
      frequency_penalty: 0.5,
      presence_penalty: 0.5
    }
  },
  balanced: {
    name: "Balanced",
    config: {
      temperature: 0.7,
      max_tokens: 2000,
      top_p: 0.9,
      frequency_penalty: 0.2,
      presence_penalty: 0.2
    }
  },
  precise: {
    name: "Precise",
    config: {
      temperature: 0.3,
      max_tokens: 2000,
      top_p: 0.8,
      frequency_penalty: 0,
      presence_penalty: 0
    }
  }
};

const BrainstormControl = ({ panels, onSubmitToPanels, currentMessage }) => {
  const [sequence, setSequence] = useState([]);
  const [messageQueue, setMessageQueue] = useState([]);
  const [selectedOutputPanel, setSelectedOutputPanel] = useState('');
  const [isProcessing, setIsProcessing] = useState(false);
  const [results, setResults] = useState(null);
  const [availableModels, setAvailableModels] = useState([]);
  const [modelSettingsOpen, setModelSettingsOpen] = useState(false);
  const [selectedPanelForSettings, setSelectedPanelForSettings] = useState(null);
  const [selectedPreset, setSelectedPreset] = useState('balanced');

  // Get configuration for a panel
  const getPanelConfig = (panelId) => {
    const panel = sequence.find(item => item.panelId === panelId);
    return panel?.config || MODEL_PRESETS.balanced.config;
  };

  // Handle preset change
  const handlePresetChange = (presetKey) => {
    if (!selectedPanelForSettings) return;
    
    setSelectedPreset(presetKey);
    setSequence(prev => prev.map(item =>
      item.id === selectedPanelForSettings.id
        ? {
            ...item,
            preset: presetKey,
            config: { ...MODEL_PRESETS[presetKey].config }
          }
        : item
    ));
  };

  // Add a panel to the sequence with default preset
  const handleAddToSequence = (panelId) => {
    setSequence(prev => [...prev, {
      id: `seq-${Date.now()}`,
      panelId,
      modelId: availableModels[0]?.id || 'default',
      preset: 'balanced',
      config: { ...MODEL_PRESETS.balanced.config }
    }]);
  };

  // Display current configuration
  const renderConfigInfo = (item) => {
    const config = item.config || MODEL_PRESETS.balanced.config;
    const preset = item.preset || 'balanced';
    
    return (
      <Box sx={{ display: 'flex', alignItems: 'center', ml: 1 }}>
        <Tooltip title={
          <Box>
            <Typography variant="body2">Preset: {MODEL_PRESETS[preset].name}</Typography>
            <Typography variant="body2">Temperature: {config.temperature}</Typography>
            <Typography variant="body2">Max Tokens: {config.max_tokens}</Typography>
            <Typography variant="body2">Top P: {config.top_p}</Typography>
          </Box>
        }>
          <IconButton size="medium" color="primary">
            <InfoIcon />
          </IconButton>
        </Tooltip>
      </Box>
    );
  };

  // Update configuration for a panel
  const updatePanelConfig = (panelId, newConfig) => {
    setSequence(prev => prev.map(item =>
      item.panelId === panelId
        ? { ...item, config: { ...item.config, ...newConfig } }
        : item
    ));
  };

  // Fetch available models on component mount
  useEffect(() => {
    fetchAvailableModels();
  }, []);

  const fetchAvailableModels = async () => {
    try {
      const response = await fetch('/api/models');
      const data = await response.json();
      if (data.status === 'online') {
        setAvailableModels(data.models);
      }
    } catch (error) {
      console.error('Error fetching models:', error);
    }
  };

  // Remove a panel from the sequence
  const handleRemoveFromSequence = (sequenceId) => {
    setSequence(prev => prev.filter(item => item.id !== sequenceId));
  };

  // Handle drag and drop reordering
  const handleDragEnd = (result) => {
    if (!result.destination) return;

    const items = Array.from(sequence);
    const [reorderedItem] = items.splice(result.source.index, 1);
    items.splice(result.destination.index, 0, reorderedItem);

    setSequence(items);
  };

  // Open model settings dialog
  const handleOpenModelSettings = (sequenceItem) => {
    setSelectedPanelForSettings(sequenceItem);
    setModelSettingsOpen(true);
  };

  // Update model for a panel
  const handleModelChange = (modelId) => {
    setSequence(prev => prev.map(item => 
      item.id === selectedPanelForSettings.id
        ? { ...item, modelId }
        : item
    ));
    setModelSettingsOpen(false);
  };

  // Start the brainstorming process
  const handleStartBrainstorm = async () => {
    if (sequence.length === 0 || !currentMessage) return;
    setIsProcessing(true);
    
    try {
      const results = [];
      
      // Process through each assistant in sequence
      for (const item of sequence) {
        const response = await processWithAssistant(item.panelId, currentMessage, item.modelId);
        results.push({
          panelId: item.panelId,
          response
        });
      }
      
      // Generate final summary and verdict
      const summary = generateSummary(results);
      setResults(summary);
      
      // Send to selected output panel if specified
      if (selectedOutputPanel) {
        onSubmitToPanels(selectedOutputPanel, summary);
      }
    } catch (error) {
      console.error('Brainstorm error:', error);
    } finally {
      setIsProcessing(false);
    }
  };

  return (
    <StrictMode>
      <Paper sx={{ p: 2, m: 2 }}>
        <Typography variant="h6" gutterBottom>
          AI Brainstorm Control
        </Typography>
        
        {/* Sequence Builder */}
        <Box sx={{ mb: 2 }}>
          <Typography variant="subtitle1" gutterBottom>
            Processing Sequence
          </Typography>
          <DragDropContext onDragEnd={handleDragEnd}>
            <Droppable droppableId="sequence">
              {(provided) => (
                <List {...provided.droppableProps} ref={provided.innerRef}>
                  {sequence.map((item, index) => (
                    <Draggable key={item.id} draggableId={item.id} index={index}>
                      {(provided) => (
                        <ListItem
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          sx={{ 
                            bgcolor: 'background.paper', 
                            mb: 1,
                            borderRadius: 1,
                            border: '1px solid',
                            borderColor: 'divider',
                            '&:hover': {
                              bgcolor: 'action.hover',
                            }
                          }}
                        >
                          <DragIcon sx={{ mr: 1, color: 'action.active' }} />
                          <ListItemText 
                            primary={
                              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                                <Typography variant="subtitle2">
                                  Panel {panels.findIndex(p => p.id === item.panelId) + 1}
                                </Typography>
                                {renderConfigInfo(item)}
                              </Box>
                            }
                            secondary={`Model: ${item.modelId} - ${MODEL_PRESETS[item.preset || 'balanced'].name}`}
                          />
                          <ListItemSecondaryAction sx={{ display: 'flex', gap: 1 }}>
                            <Tooltip title="Model Settings">
                              <IconButton 
                                onClick={() => handleOpenModelSettings(item)}
                                color="primary"
                                size="medium"
                              >
                                <SettingsIcon />
                              </IconButton>
                            </Tooltip>
                            <Tooltip title="Remove Panel">
                              <IconButton 
                                onClick={() => handleRemoveFromSequence(item.id)}
                                color="error"
                                size="medium"
                              >
                                <DeleteIcon />
                              </IconButton>
                            </Tooltip>
                          </ListItemSecondaryAction>
                        </ListItem>
                      )}
                    </Draggable>
                  ))}
                  {provided.placeholder}
                </List>
              )}
            </Droppable>
          </DragDropContext>

          {/* Add Panel to Sequence */}
          <Box sx={{ mt: 2 }}>
            {panels.map((panel, index) => (
              <Tooltip key={panel.id} title="Add to sequence">
                <Chip
                  label={`Panel ${index + 1}`}
                  onClick={() => handleAddToSequence(panel.id)}
                  icon={<AddIcon />}
                  sx={{ mr: 1 }}
                  color="primary"
                  variant="outlined"
                />
              </Tooltip>
            ))}
          </Box>
        </Box>
        
        {/* Output Panel Selector */}
        <Box sx={{ mb: 2 }}>
          <Typography variant="subtitle1" gutterBottom>
            Output Panel
          </Typography>
          <Select
            value={selectedOutputPanel}
            onChange={(e) => setSelectedOutputPanel(e.target.value)}
            fullWidth
            size="small"
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {panels.map((panel, index) => (
              <MenuItem key={panel.id} value={panel.id}>
                Panel {index + 1}
              </MenuItem>
            ))}
          </Select>
        </Box>
        
        {/* Control Buttons */}
        <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
          <Button
            variant="contained"
            color="primary"
            startIcon={<PlayIcon />}
            onClick={handleStartBrainstorm}
            disabled={isProcessing || sequence.length === 0}
            size="large"
          >
            Start Brainstorm
          </Button>
        </Box>
        
        {/* Results Display */}
        {results && (
          <Box sx={{ mt: 2 }}>
            <Typography variant="subtitle1" gutterBottom>
              Results
            </Typography>
            <Paper variant="outlined" sx={{ p: 2 }}>
              <Typography variant="body2" component="pre" sx={{ whiteSpace: 'pre-wrap' }}>
                {JSON.stringify(results, null, 2)}
              </Typography>
            </Paper>
          </Box>
        )}

        {/* Model Settings Dialog */}
        <Dialog 
          open={modelSettingsOpen} 
          onClose={() => setModelSettingsOpen(false)}
          maxWidth="sm"
          fullWidth
        >
          <DialogTitle>
            Model Settings for Panel {selectedPanelForSettings ? 
              panels.findIndex(p => p.id === selectedPanelForSettings.panelId) + 1 : 
              ''}
          </DialogTitle>
          <DialogContent>
            <FormControl fullWidth sx={{ mt: 2 }}>
              <InputLabel>Model</InputLabel>
              <Select
                value={selectedPanelForSettings?.modelId || ''}
                onChange={(e) => handleModelChange(e.target.value)}
                label="Model"
              >
                {availableModels.map((model) => (
                  <MenuItem key={model.id} value={model.id}>
                    {model.name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setModelSettingsOpen(false)}>Cancel</Button>
          </DialogActions>
        </Dialog>
      </Paper>
    </StrictMode>
  );
};

export default BrainstormControl;
